import './App.css';
import React from "react";
import AnnouncementContainer from "./components/announcement/announcementContainer";
import AnnContainer from "./components/ann/annContainer";
import Navbar from "./components/Navbar/Navbar";
import Header from "./components/Header/Header";
import {Route, Routes} from "react-router-dom";
import DisplayAnnContainer from "./components/DisplayAnn/DisplayAnnContainer";
import Accessible from "./components/Accessible/Accessible";

function App() {
    return (
        <div className="App-wrapper">
            <Header/>
            <Navbar/>
            <div className="App-wrapper-content">
                <Routes>
                    <Route  path="/ann/"
                            element = {<AnnContainer/>} />
                    <Route  path="/announcement/"
                            element = {<AnnouncementContainer/>} />
                    <Route  path="/displayAnn/"
                            element = {<DisplayAnnContainer/>} />
                    <Route  path="/Accessible/"
                            element = {<Accessible/>} />
                </Routes>
            </div>
        </div>
    );
}

export default App;
